import React from 'react'

function ProjectCard(props) {
    return (
        <div className="col-md-6">
            <a href={props.content.deployLink}>
                <img src={props.content.imageLink} alt={props.content.name}/>
                <p>{props.content.name}</p>
            </a>
            <a className="gitLink" href={props.content.gitLink}>GitHub Repo</a>
        </div>
    )
}

export default ProjectCard
